import React from 'react'
import { pushData } from '../js/actions'
import store from '../js/store'

const PageThree = () => {
  return (
    <div>
      <button onClick={ () => store.dispatch(pushData('test')) }>add data</button>
    </div>
  )
}

export default PageThree
